Object(u.a)(JSON.parse('{"ar":{"assignments":{"grading_type_selector":{"display_grade_as":"عرض التقدير كأنه","gpa_scale_explainer":"تقدير الدرجات بمقياس GPA مصمم للمدارس التي تستخدم مقياس 4.0 (أو 5.0/6.0) لكل المهام. ويشبه نظام تقدير الدرجات هذا نظام عرض الدرجة الحرفية ولكنه يشتمل على بعض الاختلافات المهمة:","gpa_scale_input_explainer":"يتم إدخال الدرجات على مقياس 4.0 . على سبيل المثال، إذا كانت المهمة من 100 نقطة، فإن إدخال 4.0 ينتج عنه 100%، وإدخال 3.0 ينتج عنه 87%، إلخ.","gpa_scale_letters_explainer":"يمكن استخدام الدرجات الحرفية إضافة إلى الدرجات الرقيمة.","gpa_scale_percentage_explainer":"لا يمكنك إدخال النقاط مباشرةً، ولكن يمكنك إدخال النسب المئوية. على سبيل المثال، إذا كانت المهمة من 50 نقطة، فلا يمكن إدخال \\"40\\"، ولكن يمكن إدخال \\"80%\\".","gpa_scale_recommendation":"يوصي نظام Canvas بعرض الدرجات كدرجات حرفية، ما لم تكن مدرستك تستخدم مقياس 4.0 (أو 5.0/6.0) لتقدير الدرجات.","gpa_scale_scores_explainer":"الدرجات المسموح بها هي الدرجات المحددة مسبقًا في نظام تقدير الدرجات فقط.","gpa_scale_title":"\\"ما هو تقدير الدرجات بمقياس GPA؟\\"","view_grading_scheme":"عرض نظام تقييم الدرجات"}}},"cy":{"assignments":{"grading_type_selector":{"display_grade_as":"Dangos Gradd fel","gpa_scale_explainer":"Mae Dull Graddio’r Raddfa GPA wedi’i gynllunio ar gyfer ysgolion sy’n defnyddio graddfa 4.0 (neu 5.0/6.0) ar gyfer pob aseiniad. Mae’r cynllun graddau hwn yn debyg i’r drefn o ddefnyddio llythrennau fel graddau, ond mae rhai gwahaniaethau pwysig rhyngddynt:","gpa_scale_input_explainer":"Mae sgoriau’n cael eu rhoi ar y raddfa 4.0. Er enghraifft, os yw aseiniad yn cael ei farcio allan o 100, bydd 4.0 yn golygu 100%, a 3.0 yn golygu 87% ac ati.","gpa_scale_letters_explainer":"Mae modd defnyddio graddau llythyren yn ogystal â graddau rhif.","gpa_scale_percentage_explainer":"Allwch chi ddim rhoi pwyntiau’n uniongyrchol, ond fe allwch chi roi canrannau. Er enghraifft, os yw aseiniad yn cael ei farcio allan o 50, allwch chi ddim rhoi \\"40\\" ond fe allwch chi roi \\"80%\\".","gpa_scale_recommendation":"Oni bai fod eich ysgol yn defnyddio graddfa 4.0 (neu 5.0/6.0) wrth raddio, mae Canvas yn argymell i chi ddefnyddio Graddau Llythyren.","gpa_scale_scores_explainer":"Dim ond sgoriau sydd wedi’u diffinio’n barod yn y cynllun graddau sy’n cael ei caniatáu.","gpa_scale_title":"\\"Beth yw Dull Graddio’r Raddfa GPA?\\"","view_grading_scheme":"Gweld Cynllun Graddau"}}},"da":{"assignments":{"grading_type_selector":{"display_grade_as":"Vis karakter som","gpa_scale_explainer":"GPA scalaklassificering er designet til skoler, som bruger en 4.0 skala (eller 5.0/6.0) til alle opgaver. Denne karakterordning ligner visning af bogstavkarakterer, men omfatter enkelte vigtige forskellige:","gpa_scale_input_explainer":"Resultatet indtastes på 4.0-skalaen. Hvis for eksempel en opgave består af i alt 100 point, vil indtastning af 4.0 udgøre 100 %, 3.0 udgøre 87 % osv.","gpa_scale_letters_explainer":"Foruden karakterer med tal kan man også bruge karakterer med bogstaver.","gpa_scale_percentage_explainer":"Du kan ikke indtaste point direkte, men du kan indtaste procentdele. Hvis for eksempel en opgave består af i alt 50 point, vil indtastning af \\"40\\" ikke fungere, men \\"80%\\" vil.","gpa_scale_recommendation":"Med mindre din skole bruger en 4.0 skala (eller 5.0/6.0), anbefaler Canvas at vise karaktererne som bogstaver.","gpa_scale_scores_explainer":"De eneste tilladte resultater er prædefineret i karakterordningen.","gpa_scale_title":"Karakterordning-omregningstabel","view_grading_scheme":"Vis karakterordning"}}},"da-x-k12":{"assignments":{"grading_type_selector":{"display_grade_as":"Vis vurdering som","gpa_scale_explainer":"GPA scalaklassificering er designet til skoler, som bruger en 4.0 skala (eller 5.0/6.0) til alle opgaver. Denne vurderingsordning ligner visning af bogstavvurderinger, men omfatter enkelte vigtige forskellige:","gpa_scale_input_explainer":"Resultatet indtastes på 4.0-skalaen. Hvis for eksempel en opgave består af i alt 100 point, vil indtastning af 4.0 udgøre 100 %, 3.0 udgøre 87 % osv.","gpa_scale_letters_explainer":"Foruden vurderinger med tal kan man også bruge vurderinger med bogstaver.","gpa_scale_percentage_explainer":"Du kan ikke indtaste point direkte, men du kan indtaste procentdele. Hvis for eksempel en opgave består af i alt 50 point, vil indtastning af \\"40\\" ikke fungere, men \\"80%\\" vil.","gpa_scale_recommendation":"Med mindre din skole bruger en 4.0 skala (eller 5.0/6.0), anbefaler Canvas at vise vurderingerne som bogstaver.","gpa_scale_scores_explainer":"De eneste tilladte resultater er prædefineret i vurderingsordningen.","gpa_scale_title":"Vurderingsordning-omregningstabel","view_grading_scheme":"Vis vurderingsordning"}}},"de":{"assignments":{"grading_type_selector":{"display_grade_as":"Note anzeigen als","gpa_scale_explainer":"Die Benotung nach GPA-Skala ist für Bildungseinrichtungen vorgesehen, die eine Skala von 4.0 (oder 5.0/6.0) für alle Aufgaben verwenden. Dieses Benotungssystem entspricht der Anzeige von Buchstabennoten, mit einigen wichtigen Ausnahmen:","gpa_scale_input_explainer":"Die Punktzahlen werden auf einer Skala bis 4.0 eingegeben. Wenn eine Aufgabe beispielsweise insgesamt 100 Punkte hat, steht die Eingabe 4.0 für 100 %, 3.0 für 87 % usw.","gpa_scale_letters_explainer":"Buchstabennoten können zusätzlich zu Zahlennoten verwendet werden.","gpa_scale_percentage_explainer":"Punkte können nicht direkt eingegeben werden. Sie können jedoch Prozentsätze eingeben. Beispiel: Wenn für eine Aufgabe 50 Punkte vorgesehen sind, können Sie nicht 40 eingeben, sondern 80 %.","gpa_scale_recommendation":"Canvas empfiehlt, Noten als Buchstabennoten anzuzeigen, es sei denn, Ihre Bildungseinrichtung verwendet die 4.0-Skala (oder 5.0/6.0) für die Benotung.","gpa_scale_scores_explainer":"Die zulässigen Punktzahlen sind im Benotungssystem vordefiniert.","gpa_scale_title":"„Was versteht man unter Benotung nach GPA-Skala?“","view_grading_scheme":"Benotungssystem anzeigen"}}},"el":{"assignments":{"grading_type_selector":{"display_grade_as":"Εμφάνιση Βαθμού ως","gpa_scale_explainer":"Η Κλίμακα Βαθμολόγησης GPA έχει σχεδιαστεί για σχολεία που χρησιμοποιούν κλίμακα στα 4.0 (ή στα 5.0/6.0) για όλες τις εργασίες. Αυτός ο κανονισμός βαθμολόγησης είναι παρόμοιος με τη Βαθμολόγηση με Γράμματα, αλλά παρουσιάζει ορισμένες σημαντικές διαφορές:","gpa_scale_input_explainer":"Οι βαθμολογίες απεικονίζονται σε κλίμακα έως 4.0. Για παράδειγμα, αν μια εργασία βαθμολογείται με άριστα τα 100 μόρια, η καταχώριση 4.0 αντιστοιχεί στο 100%, η καταχώριση 3.0 στο 87%, κ.λπ.","gpa_scale_letters_explainer":"Η βαθμολόγηση με γράμματα μπορεί να χρησιμοποιηθεί επιπλέον της βαθμολόγησης με αριθμούς.","gpa_scale_percentage_explainer":"Δεν μπορείτε να εισαγάγετε απευθείας μόρια, αλλά μπορείτε να εισαγάγετε ποσοστά. Για παράδειγμα, αν μια εργασία βαθμολογείται με άριστα τα 50 μόρια, η καταχώριση «40» δεν θα λειτουργήσει, αλλά η καταχώριση «80%» θα λειτουργήσει.","gpa_scale_recommendation":"Το Canvas συνιστά την εμφάνιση της Βαθμολόγησης με Γράμματα, εκτός και αν το σχολείο σας χρησιμοποιεί κλίμακα έως 4.0 (ή 5.0/6.0) για τη βαθμολόγηση.","gpa_scale_scores_explainer":"Οι μόνες επιτρεπόμενες βαθμολογίες έχουν προκαθοριστεί στο σύστημα βαθμολόγησης.","gpa_scale_title":"«Τι είναι η Κλίμακα Βαθμολόγησης GPA;»","view_grading_scheme":"Προβολή Συστήματος Βαθμολόγησης"}}},"en-AU":{"assignments":{"grading_type_selector":{"display_grade_as":"Display Mark as","gpa_scale_explainer":"GPA Scale Grading is designed for schools that use a 4.0 scale (or 5.0/6.0) for all assignments. This grading scheme is similar to the Letter Grade display but features some important differences:","gpa_scale_input_explainer":"Scores are input on the 4.0 scale. For instance, if an assignment is out of 100 points, inputting 4.0 results in 100%, 3.0 results in 87%, etc.","gpa_scale_letters_explainer":"Letter marks can be used in addition to number marks.","gpa_scale_percentage_explainer":"You cannot input points directly, but can input percentages. For instance, if an assignment is out of 50 points, inputting \\"40\\" will not work, but \\"80%\\" will.","gpa_scale_recommendation":"Unless your school uses a 4.0 scale (or 5.0/6.0) for grading, Canvas recommends displaying marks as Letter Grade.","gpa_scale_scores_explainer":"The only scores allowed are predefined in the grading scheme.","gpa_scale_title":"\\"What is GPA Scale Grading?\\"","view_grading_scheme":"View Grading Scheme"}}},"en-CA":{"assignments":{"grading_type_selector":{"display_grade_as":"Display Grade as","gpa_scale_explainer":"GPA Scale Grading is designed for schools that use a 4.0 scale (or 5.0/6.0) for all assignments. This grading scheme is similar to the Letter Grade display but features some important differences:","gpa_scale_input_explainer":"Scores are input on the 4.0 scale. For instance, if an assignment is out of 100 points, inputting 4.0 results in 100%, 3.0 results in 87%, etc.","gpa_scale_letters_explainer":"Letter grades can be used in addition to number grades.","gpa_scale_percentage_explainer":"You cannot input points directly, but can input percentages. For instance, if an assignment is out of 50 points, inputting \\"40\\" will not work, but \\"80%\\" will.","gpa_scale_recommendation":"Unless your school uses a 4.0 scale (or 5.0/6.0) for grading, Canvas recommends displaying grades as Letter Grade.","gpa_scale_scores_explainer":"The only scores allowed are predefined in the grading scheme.","gpa_scale_title":"\\"What is GPA Scale Grading?\\"","view_grading_scheme":"View Grading Scheme"}}},"en-GB":{"assignments":{"grading_type_selector":{"display_grade_as":"Display grade as","gpa_scale_explainer":"GPA Scale Grading is designed for schools that use a 4.0 scale (or 5.0/6.0) for all assignments. This grading scheme is similar to the Letter Grade display but features some important differences:","gpa_scale_input_explainer":"Scores are input on the 4.0 scale. For instance, if an assignment is out of 100 points, inputting 4.0 results in 100%, 3.0 results in 87%, etc.","gpa_scale_letters_explainer":"Letter grades can be used in addition to number grades.","gpa_scale_percentage_explainer":"You cannot input points directly, but can input percentages. For instance, if an assignment is out of 50 points, inputting \\"40\\" will not work, but \\"80%\\" will.","gpa_scale_recommendation":"Unless your school uses a 4.0 scale (or 5.0/6.0) for grading, Canvas recommends displaying grades as Letter Grade.","gpa_scale_scores_explainer":"The only scores allowed are predefined in the grading scheme.","gpa_scale_title":"What is GPA scale grading?","view_grading_scheme":"View grading scheme"}}},"es":{"assignments":{"grading_type_selector":{"display_grade_as":"Mostrar calificación como","gpa_scale_explainer":"La calificación de escala GPA se ha diseñado para las escuelas que utilizan una escala de 4,0 (o 5,0/6,0) para todas las tareas. Este esquema de calificaciones es parecido a la calificación por letra, pero presenta varias diferencias importantes:","gpa_scale_input_explainer":"Las puntuaciones aparecen en la escala de 4,0. Por ejemplo, si a una tarea se le asignan 100 puntos, un 4,0 corresponderá al 100 %, un 3,0 corresponderá a un 87 %, etc.","gpa_scale_letters_explainer":"Las calificaciones por letras se pueden utilizar como complemento de las calificaciones por números.","gpa_scale_percentage_explainer":"No se pueden dar puntos directamente, pero sí porcentajes. Por ejemplo, si una tarea tiene un valor de 50 puntos, no podrá poner \\"40\\", pero sí \\"80 %\\".","gpa_scale_recommendation":"A menos que su centro utilice una escala de 4,0 (o 5,0/6,0) para calificar, Canvas recomienda que utilice la calificación por letra para mostrar la calificación.","gpa_scale_scores_explainer":"Solo se permiten los puntajes predefinidos en el esquema de calificaciones.","gpa_scale_title":"\\"¿Qué es la calificación de escala GPA?\\"","view_grading_scheme":"Ver esquema de calificaciones"}}},"fa":{"assignments":{"grading_type_selector":{"display_grade_as":"نمایش نمره به عنوان","gpa_scale_explainer":"نمره گذاری مقیاس معدل برای دانشگاه هایی که از مقیاس 4.0 ( یا 5.0/6.0 ) برای همه تکلیف ها استفاده می کنند، طراحی شده است. این طرح نمره گذاری مشابه نمایش نمره حرفی است ولی دارای چند تفاوت مهم است:","gpa_scale_input_explainer":"نمره ها در مقیاس 4.0 وارد می شوند. برای مثال، اگر یک تکلیف 100 نمره داشته باشد، وارد کردن نمره 4.0 به 100 درصد و نمره 3.0 به 87 درصد منتج خواهد شد.","gpa_scale_letters_explainer":"علاوه بر نمره های عددی، می توان از نمره های حرفی نیز استفاده کرد.","gpa_scale_percentage_explainer":"نمی توانید امتیازها را مستقیما وارد کنید، ولی می توانید درصد ها را وارد کنید. به عنوان مثال، اگر یک تکلیف از 50 امتیاز باشد، وارد کردن 40 جواب نمی دهد، اما وارد کردن 80% جواب خواهد داد.","gpa_scale_recommendation":"اگر دانشگاه شما از مقیاس 4.0 یا (5.0/6.0) برای نمره گذاری استفاده نمی کند، کانواس نمایش نمره ها به صورت نمره حرفی را توصیه می کند.","gpa_scale_scores_explainer":"تنها نمره های مجاز در طرح نمره گذاری از پیش تعریف شده اند.","gpa_scale_title":"«نمره گذاری مقیاس معدل چیست؟»","view_grading_scheme":"مشاهده طرح نمره گذاری"}}},"fi":{"assignments":{"grading_type_selector":{"display_grade_as":"Näytä arvosana seuraavasti","gpa_scale_explainer":"GPA-asteikon arvosanojen anto suunniteltiin kouluille, jotka käyttävät kaikille tehtäville 4.0-asteikkoa (tai 5.0/6.0). Tämä arvosanojen antojärjestelmä on samanlainen kuin kirjainarvosanan näyttö, mutta siinä on joitakin tärkeitä eroja:","gpa_scale_input_explainer":"Pistemäärät syötetään 4.0-asteikolla. Jos tehtävässä on esimerkiksi 100 pistettä, 4.0-tulosten syöttäminen tuo tuloksesi 100 %, 3.0-tulosten 87 %, jne.","gpa_scale_letters_explainer":"Kirjainarvosanoja voidaan käyttää numeroarvosanojen lisäksi.","gpa_scale_percentage_explainer":"Et voi syöttää pisteitä suoraan, mutta voit syöttää prosenttilukuja. Jos tehtävässä on esimerkiksi 50 pistettä, et voi syöttää \\"40\\" vaan sinun täytyy syöttää 80 %, jne.","gpa_scale_recommendation":"Ellei koulusi käytä 4.0-asteikkoa (tai 5.0/6.0) arvosanojen antoon, Canvas suosittelee arvosanojen antamista kirjainarvosanoina.","gpa_scale_scores_explainer":"Vain sallitut pistemäärät määritetään arvosanojen antojärjestelmässä.","gpa_scale_title":"Mikä on GPA-asteikon arvosanojen anto?","view_grading_scheme":"Näytä arvosanojen asteikko"}}},"fr":{"assignments":{"grading_type_selector":{"display_grade_as":"Afficher la note en tant que","gpa_scale_explainer":"Le GPA, système de notation américain, est conçu pour les établissements qui utilisent l’échelle 4.0 (ou 5.0/6.0) pour tous les tâches. Il équivaut au système de notation avec les lettres, mais avec des différences importantes :","gpa_scale_input_explainer":"Les notes sont calculées selon l’échelle 4.0. Par exemple, si un travail est sur 100 points, attribuer 4.0 donne 100 %, 3.0 donne 87 %, etc.","gpa_scale_letters_explainer":"Des lettres peuvent être utilisées en plus des chiffres pour les notes.","gpa_scale_percentage_explainer":"Vous ne pouvez pas attribuer directement des points, mais vous pouvez indiquer des pourcentages. Par exemple, pour un travail noté sur 50 points, vous ne pouvez pas inscrire 40, vous devez indiquer 80 %.","gpa_scale_recommendation":"À moins que votre établissement utilise l\'échelle 4.0 (ou 5.0/6.0) pour la notation, Canvas conseille d’afficher les notes sous forme de lettres.","gpa_scale_scores_explainer":"Les seules notes acceptées sont celles qui sont prédéfinies dans le système de notation.","gpa_scale_title":"« Qu’est-ce que le système de notation GPA ? »","view_grading_scheme":"Voir le système de notation"}}},"fr-CA":{"assignments":{"grading_type_selector":{"display_grade_as":"Afficher la note en tant que","gpa_scale_explainer":"Le GPA, système de notation américain, est conçu pour les établissements qui utilisent l’échelle 4.0 (ou 5.0/6.0) pour tous les tâches. Il équivaut au système de notation avec les lettres, mais avec des différences importantes :","gpa_scale_input_explainer":"Les notes sont calculées selon l’échelle 4.0. Par exemple, si une tâche est sur 100 points, attribuer 4.0 donne 100 %, 3.0 donne 87 %, etc.","gpa_scale_letters_explainer":"Des lettres peuvent être utilisées en plus des chiffres pour les notes.","gpa_scale_percentage_explainer":"Vous ne pouvez pas attribuer directement des points, mais vous pouvez indiquer des pourcentages. Par exemple, pour une tâche noté sur 50 points, vous ne pouvez pas inscrire 40, vous devez indiquer 80 %.","gpa_scale_recommendation":"À moins que votre établissement utilise l\'échelle 4.0 (ou 5.0/6.0) pour la notation, Canvas conseille d’afficher les notes sous forme de lettres.","gpa_scale_scores_explainer":"Les seules notes acceptées sont celles qui sont prédéfinies dans le système de notation.","gpa_scale_title":"« Qu’est-ce que le système de notation GPA? »","view_grading_scheme":"Voir le système de notation"}}},"he":{"assignments":{"grading_type_selector":{"display_grade_as":"הצג ציונים כ-","gpa_scale_explainer":"סולם ההערכה של הGPA תוכנן לבתי ספר אשר משתמשים בסולם 4.0 (או 5.0/6.0) לכל המשימות. סכימת דירוג זו דומה לתצוגת סכימת ההערכה המילולית  אך עם כמה הבדלים משמעותיים:","gpa_scale_input_explainer":"הציונים הם על בסיס סולם 4.0. למשל, אם למשימה 100 נקודות, השקלול של 3.5 מתוך 4.0 הוא 87%, וכו\'. ","gpa_scale_letters_explainer":"ניתן להשתמש בהערכה מילולית בנוסף לציונים המספריים.","gpa_scale_percentage_explainer":"אין אפשרות להקליד ניקוד באופן ישיר, אך אפשר להקליד אחוזים. למשל, אם המשימה היא מתוך 50 נקודות, \\"40\\" לא יעבוד, אך 80% כן.","gpa_scale_recommendation":"אלא אם בית ספרך משתמש בסולם 4.0 (או 5.0 / 6.0) להערכות, קנבס ממליץ הצגת הציונים כהערכה מילולית","gpa_scale_scores_explainer":"הציונים האפשריים הם רק מתוך סכימת הערכה שהוגדרה מראש.","gpa_scale_title":"\\"מה זה סולם הערכה GPA?\\"","view_grading_scheme":"עיון בסכימת ההערכה"}}},"ht":{"assignments":{"grading_type_selector":{"display_grade_as":"Afiche Klas tankou","gpa_scale_explainer":"Echèl Klasman GPA fèt pou lekòl ki itilize echèl 4.0 (oswa 5.0/6.0) pou tout sesyon yo. Sistèm notasyon sa a sanble ak afichaj Notasyon an Lèt la men yo gen kèk gran diferans:","gpa_scale_input_explainer":"Nòt yo antre nan echèl 4.0. Pa egzanp, si yon sesyon sou 100 pwen, antre 4.0 ap bay 100%, 3.0 bay 87%, elatriye.","gpa_scale_letters_explainer":"Notasyon an lèt yo kapab itilize anplis de nòt nimerik yo.","gpa_scale_percentage_explainer":"Ou kapab itilize pwen antre yo dirèkteman, men kapab antre pousantaj yo. Pa egzanp, si yon sesyon sou 50, si w antre \\"40\\" li pa p fonksyone, men \\"80%\\" ap bon.","gpa_scale_recommendation":"Sof si lekòl ou a itilize yon echèl 4.0 (oswa 5.0/6.0) pou klasman, Canvas rekòmande pou afiche nòt yo an Notasyon an Lèt.","gpa_scale_scores_explainer":"Sèl nòt ki akseptab yo, yo predefini nan sistèm notasyon an.","gpa_scale_title":"\\"Kisa ki Echèl Klasman GPA a?\\"","view_grading_scheme":"Afiche Sistèm Notasyon"}}},"hu":{"assignments":{"grading_type_selector":{"display_grade_as":"Osztályzat megjelenítése, mint","gpa_scale_explainer":"A GPA értékelési skála azon iskoláknak lett tervezve, amelyek minden feladatnál a 4.0 (vagy 5.0/6.0) értékelést használják. Az osztályozási rendszer hasonló a Betű alapú osztályozási rendszerhez, néhány fontos különbséggel:","gpa_scale_input_explainer":"A pontszámok egy 4 fokú skálán lesznek elosztva. Ha például egy feladat 100 pontot ér, a 4-es rögzítése 100%-ot,a  3-as rögzítése 87%-ot eredményez, stb.","gpa_scale_letters_explainer":"Betű alapú érdemjegyek csak a szám alapú érdemjegyek mellett használhatóak ","gpa_scale_percentage_explainer":"Nem tud közvetlenül pontokat beírni, de százalékokat igen. Például, ha egy feladat 50 pontot ér, a \\"40\\" nem fog működni, de a \\"80%\\" igen.","gpa_scale_recommendation":"Ha az iskolája egy négyfokú (vagy ötfokú, esetleg hatfokú) skálát használ az osztályzásra, a Canvas azt ajánlja, hogy az érdemjegyeket betűként jelenítse meg.","gpa_scale_scores_explainer":"Csak az osztályzási rendszerben előre meghatározott pontszámok engedélyezettek. ","gpa_scale_title":"\\"Mit jelent a GPA skála szerinti értékelés?\\"","view_grading_scheme":"Osztályzási rendszer megtekintése"}}},"hy":{"assignments":{"grading_type_selector":{"display_grade_as":"Ցույց տալ գնահատականը որպես","gpa_scale_explainer":"Գնահատման GPA համակարգը մշակված է այն դպրոցների համար, որոնք բոլոր հանձնարարությունների համար օգտագործում են 4.0 բալանոց համակարգ (կամ 5.0/6.0): Գնահատման այդ սխեման նման է տառերով գնահատման, սակայն առկա են որոշ կարևոր տարբերություններ:","gpa_scale_input_explainer":"Գնահատականները մուտքագրվում են  4.0 բալանոց համակարգով: Օրինակ, եթե հանձնարարությունը 100 բալ է ստացել, ապա 4.0 արդյունքը համարժեք է 100%, 3.0 արդյունքը՝ 87%  և այլն:","gpa_scale_letters_explainer":"Տառերով գնահատականները կարող են օգտագործվել ի լրումն  թվային գնահատականների:","gpa_scale_percentage_explainer":"Դուքկարող եք ուղղակիորեն մուտքագրել ոչ թե գնահատականները, այլ տոկոսները: Օրինակ, եթե հանձնարարության համար 50 միավոր է նախատեսվում, ապա 40 միավոր մուտքագրելը հնարավոր չի լինի, անհրաժեշտ է մուտքագրել 80%:   ","gpa_scale_recommendation":"Այն դեպքերում, երբ ձեր դպրոցը չի օգտագործում 4.0 բալանոց համակարգ (կամ 5.0/6.0), Canvas-ը առաջարկում է գնահատել  տառային համակարգի միջոցով: ","gpa_scale_scores_explainer":"Միակ ընդունելի գնահատականները նշված են գնահատման սխեմայում:","gpa_scale_title":"Ի՞նչ է GPA գնահատման համակարգը:","view_grading_scheme":"Դիտել գնահատման սխեման"}}},"is":{"assignments":{"grading_type_selector":{"display_grade_as":"Sýna einkunn sem","gpa_scale_explainer":"GPA einkunnakvarði er fyrir skóla sem nota 4,0 kvarða (eða 5,0/6,0) fyrir öll verkefni. Þessi einkunnakvarði er svipaður bókstafseinkunnum en nokkur mikilvæg atriði eru öðruvísi:","gpa_scale_input_explainer":"Einkunnir eru skráðar á kvarðanum 4,0. Dæmi: Ef verkefni er upp á 100 punkta, þá gefur 4,0 100%, 3,0 87% og svo framvegis.","gpa_scale_letters_explainer":"Bókstafseinkunnir má nota ásamt tölueinkunnum","gpa_scale_percentage_explainer":"Þú getur ekki skráð punkta beint en getur skráð hlutfall. Dæmi: Ef verkefni er upp á 50 punkta, dugar ekki að skrá \\"40\\" en \\"80%\\" dugar.","gpa_scale_recommendation":"Ef skólinn þinn notar ekki 4,0 kvarðann (eða 5,0/6,0) fyrir einkunnagjöf, mælir Canvas með bókstafseinkunnum.","gpa_scale_scores_explainer":"Einu leyfilegu einkunnirnar eru skilgreindar í einkunnakvarðanum.","gpa_scale_title":"„Hvað er GPA einkunnagjöf?\\"","view_grading_scheme":"Skoða einkunnakvarða"}}},"it":{"assignments":{"grading_type_selector":{"display_grade_as":"Visualizza voto come","gpa_scale_explainer":"La valutazione basata su scala GPA è designata per le scuole che utilizzano una scala 4,0 (o 5,0/6,0) per tutti i compiti. Questo schema di valutazione è simile alla visualizzazione dei voti in lettere ma presenta alcune importanti differenze:","gpa_scale_input_explainer":"I punteggi sono immessi in base alla scala 4,0. Ad esempio, se un compito è valutato su una scala a 100 punti, l\'inserimento di 4,0 darà come risultato 100%, 3,0 darà come risultato 87% e così via.","gpa_scale_letters_explainer":"I voti in lettere possono essere utilizzati in aggiunta ai voti in valori numerici.","gpa_scale_percentage_explainer":"Non puoi immettere i punti direttamente, ma puoi immettere le percentuali. Ad esempio, se un compito è valutato su una scala a 50 punti, l\'inserimento di \\"40\\" non darà alcun risultato, mentre \\"80%\\" funzionerà.","gpa_scale_recommendation":"A meno che la scuola non utilizzi una scala 4,0 (o 5,0/6,0) per la valutazione, Canvas consiglia la visualizzazione dei voti sotto forma di lettere.","gpa_scale_scores_explainer":"Gli unici punteggi consentiti sono predefiniti nello schema di valutazione.","gpa_scale_title":"\\"Che cos\'è la valutazione basata su scala GPA?\\"","view_grading_scheme":"Visualizza schema di valutazione"}}},"ja":{"assignments":{"grading_type_selector":{"display_grade_as":"成績の表示方法","gpa_scale_explainer":"GPA スケール採点は、すべての課題で 4.0 満点 (場合によっては 5.0 や 6.0 満点) のスケールを使用する学校のための採点法です。この採点スキームは、レター グレード表示と似ていますが、重要な相違点がいくつかあります。","gpa_scale_input_explainer":"スコアは 4.0 満点のスケールで入力されます。たとえば 100 点満点の課題では、4.0 の成績なら 100%、3.0 の成績なら 87% となります。","gpa_scale_letters_explainer":"数字の成績に加えて、レター グレードを使用することもできます。","gpa_scale_percentage_explainer":"点数をそのまま入力するのではなく、パーセンテージで入力します。たとえば、ある課題が 50 点満点の場合は、「40」ではなく「80%」と入力します。","gpa_scale_recommendation":"学校で成績に 4.0 満点 (または 5.0/6.0 満点) のスケールを使用していない場合は、成績をレター グレードで表示することをお勧めします。","gpa_scale_scores_explainer":"採点スキームに事前定義されているスコアのみを使用できます。","gpa_scale_title":"GPA スケール採点とは","view_grading_scheme":"採点スキームの表示"}}},"mi":{"assignments":{"grading_type_selector":{"display_grade_as":"Whakāu Kōeke rite","gpa_scale_explainer":"Kei te hangaia GPA Tauine māhiti i te kura e whakamahi i te tauine 4.0 (rānei 5.0 / 6.0) mō ngā whakataunga katoa. Ko rite ki te whakāturanga Kōeke Reta tēnei kaupapa kōeke ēngari āhuatanga ētahi rerekētanga nui:","gpa_scale_input_explainer":"Ngä kaute he wāhi i runga i te tauine 4.0. No te tauira, ki te he te whakataunga i roto i te 100 ngā, uru ana hua 4.0 i roto i te 100%, hua 3.0 i roto i te 87%, me ētahi atu","gpa_scale_letters_explainer":"Ka taea te whakamahi kōeke reta i roto i te tua ki ngā auroro tau.","gpa_scale_percentage_explainer":"E kore e taea e koe ngā tāuru hāngai, ēngari ōrau taea tāuru. No te tauira, ki te he te whakataunga i roto i te 50 ngā, uru ana \\"40\\" e kore e mahi, ēngari \\"80%\\" ka.","gpa_scale_recommendation":"Tēnā ka whakamahia e tō kura i te tauine 4.0 (rānei 5.0 / 6.0) mō te kōeke, taunaki ana Canvas whakaatu kōeke rite Kōeke Reta.","gpa_scale_scores_explainer":"He tautuhia kē i roto i te kaupapa kōeke te kaute anake whakāetia.","gpa_scale_title":"\\"He aha te GPA Tauine Kōeke?\\"","view_grading_scheme":"Tirohia Aronui Kōeke"}}},"nb":{"assignments":{"grading_type_selector":{"display_grade_as":"Vis karakteren som","gpa_scale_explainer":"Tallkaraktersetting er laget for institusjoner som benytter en vurderingerskala med tall (for eks. 0-4.0, 0-5.0 eller 0-6.0) for alle innleveringer/oppgaver. Denne vurderingsskalaen er tilsvarende den for bokstavkarakter, men har noen vesentlige forskjeller:","gpa_scale_input_explainer":"Resultat er satt på 4.0 skalaen. For eksempel, hvis en oppgave er beregnet ut fra 100 poeng, vil 4.0 resultere i 100%, 3.0 i 87%, etc.","gpa_scale_letters_explainer":"Bokstavkarakter kan benyttes i tillegg til tallvurderinger.","gpa_scale_percentage_explainer":"Du kan ikke legge inn poeng direkte, men prosenttall kan legges inn. For eksempel, hvis en oppgave totalt kan gi 50 poeng, hjelper det ikke å legge inn 40 poeng, men \\"80%\\" gjør susen.","gpa_scale_recommendation":"Med unntak av de tilfeller der din institusjon benytter tallvurderinger (for eks. 0-4.0/0-5.0/0-6.0) anbefaler Canvas å vise karakterer som bokstavvurderinger.","gpa_scale_scores_explainer":"De eneste resultatene som tillates, er de som er forhåndsdefinert i vurderingsskala.","gpa_scale_title":"\\"Hva er tallkaraktersetting?\\"","view_grading_scheme":"Vis vurderingsskala"}}},"nb-x-k12":{"assignments":{"grading_type_selector":{"display_grade_as":"Vis vurderingen som","gpa_scale_explainer":"Tallvurdering er laget for institusjoner som benytter en vurderingerskala med tall (for eks. 0-4.0, 0-5.0 eller 0-6.0) for alle innleveringer/oppgaver. Denne vurderingsskalaen er tilsvarende den for bokstavvurdering, men har noen vesentlige forskjeller:","gpa_scale_input_explainer":"Resultat er satt på 4,0 skalaen. For eksempel, hvis en oppgave er beregnet ut fra 100 poeng, vil 4.0 resultere i 100 %, 3,0 i 87 %, osv.","gpa_scale_letters_explainer":"Bokstavvurdering kan benyttes i tillegg til tallvurderinger.","gpa_scale_percentage_explainer":"Du kan ikke legge inn poeng direkte, men prosenttall kan legges inn. For eksempel, hvis en oppgave totalt kan gi 50 poeng, hjelper det ikke å legge inn 40 poeng, men \\"80 %\\" gjør susen.","gpa_scale_recommendation":"Med unntak av de tilfeller der din institusjon benytter tallvurderinger (for eks. 0-4.0/0-5.0/0-6.0) anbefaler Canvas å vise vurderinger som bokstavvurderinger.","gpa_scale_scores_explainer":"De eneste resultatene som tillates, er de som er forhåndsdefinert i vurderingsskala.","gpa_scale_title":"\\"Hva er tallvurdering?\\"","view_grading_scheme":"Vis vurderingsskala"}}},"nl":{"assignments":{"grading_type_selector":{"display_grade_as":"Geef cijfer aan als","gpa_scale_explainer":"Het gemiddelde eindcijfer is ontworpen voor instellingen die voor alle opdrachten een schaal van 4.0 (of 5.0/6.0) gebruiken. Dit beoordelingsschema is vergelijkbaar met op de display van het lettercijfer maar verschilt op enkele belangrijke punten:","gpa_scale_input_explainer":"Cijfers worden op de schaal van 4.0 ingevoerd. Bijvoorbeeld, als een opdracht 100 punten oplevert, dan wordt 100% als 4.0 ingevoerd, 87% als 3.0, etc.","gpa_scale_letters_explainer":"Lettercijfers kunnen naast getal eindcijfers worden gebruikt.","gpa_scale_percentage_explainer":"Je kunt geen punten direct invoeren, maar je kunt wel percentages invoeren. Als je bijvoorbeeld een opdracht hebt die 50 punten waard is, zal \\"40\\" invoeren niet lukken, maar \\"80%\\" zal wel lukken.","gpa_scale_recommendation":"Tenzij jouw instelling een schaal van 4.0 of (5.0/6.0) gebruikt, raadt Canvas aan om eindcijfers als lettercijfer aan te geven.","gpa_scale_scores_explainer":"De enige scores die toegestaan zijn, zijn al vooraf in het beoordelingsschema gedefinieerd.","gpa_scale_title":"\\"Wat is het gemiddelde eindcijfer?\\"","view_grading_scheme":"Beoordelingsschema weergeven"}}},"nn":{"assignments":{"grading_type_selector":{"display_grade_as":"Vis vurderingsresultat som","gpa_scale_explainer":"Gradert vurdering (GPA) er utforma for institusjonar som brukar ein talkarakterskala som 0–4.0, 0–5.0 eller 0–6.0 på alle oppgåver. Vurderingsskjemaet liknar på bokstavkaraktervisinga, men har nokre viktige ulikskapar:","gpa_scale_input_explainer":"Poengsummar er mata inn på 4.0-skalaen. Dersom ei oppgåve for eksempel blir rekna ut frå 100 poeng vert 4.0 100 %, 3.0 vert 87 %, osv.","gpa_scale_letters_explainer":"Bokstavkarakterar kan brukast i tillegg til talkarakterar.","gpa_scale_percentage_explainer":"Du kan ikkje legge inn poeng direkte, men du kan legge inn prosenttal. Dersom ei oppgåve for eksempel blir rekna til 50 poeng, fungerer det ikkje å legge inn \\"40\\", men \\"80%\\" fungerer.","gpa_scale_recommendation":"Canvas råder deg til å bruke bokstavkaraktersetjing, om ikkje institusjonen allereie nyttar talkaraktersetjing som 0–4.0, 0–5.0 eller 0–6.0.","gpa_scale_scores_explainer":"Dei einaste tillatne poengsummane er førehandsdefinerte i karaktersystemet.","gpa_scale_title":"\\"Kva er GPA Scale Grading?\\"","view_grading_scheme":"Vis karakterskjema"}}},"pl":{"assignments":{"grading_type_selector":{"display_grade_as":"Wyświetl ocenę jako","gpa_scale_explainer":"Ocenianie w skali GPA jest przeznaczone do szkół, w których stosuje się opis 4.0 (lub 5.0/6.0) do wszystkich zadań. Ten schemat oceniania jest podobny do schematu oceniania literami, jednak ma kilka istotnych różnic:","gpa_scale_input_explainer":"Wyniki przedstawione są w 4-stopniowej skali. Jeśli na przykład do zdobycia jest 100 punktów, ocena 4.0 oznacza 100%, 3.0 oznacza 87% itd.","gpa_scale_letters_explainer":"Zamiast ocen cyfowych można stosować oceny literowe","gpa_scale_percentage_explainer":"Nie można bezpośrednio wprowadzać punktów, lecz procenty. Jeśli, na przykład, w zadaniu można uzyskać 50 punktów, wprowadzenie wartości „40” nie będzie poprawne, natomiast wartość procentowa „80%” będzie poprawna.","gpa_scale_recommendation":"Jeśli szkoła nie korzysta ze skali oceniania 4.0 (lub 5.0/6.0), system Canvas zaleca wyświetlanie ocen literowych.","gpa_scale_scores_explainer":"Można stosować jedynie wyniki wcześniej zdefiniowane w schemacie oceniania.","gpa_scale_title":"„Jak wygląda ocenianie w skali GPA?”","view_grading_scheme":"Pokaż schemat oceniania"}}},"pt":{"assignments":{"grading_type_selector":{"display_grade_as":"Mostrar nota como","gpa_scale_explainer":"A Avaliação em Escala GPA destina-se a escolas que utilizam uma escala de 4.0 (ou 5.0/6.0) para todas as tarefas. Este esquema de avaliação é semelhante à visualização de Nota por letra, mas apresenta algumas diferenças importantes:","gpa_scale_input_explainer":"As pontuações são introduzidas na escala de 4.0. Por exemplo, se uma tarefa for avaliada em 100 pontos possíveis, a introdução de 4.0 resulta em 100%, 3.0 resulta em 87%, etc.","gpa_scale_letters_explainer":"Além de notas numéricas, também é possível utilizar notas por letra.","gpa_scale_percentage_explainer":"Não é possível introduzir pontos diretamente, mas pode introduzir percentagens. Por exemplo, se uma tarefa for avaliada em 50 pontos possíveis, a introdução de \\"40\\" não funciona, mas \\"80%\\" sim.","gpa_scale_recommendation":"A não ser que a sua escola utilize uma escala de 4.0 (ou 5.0/6.0) para avaliação, o Canvas recomenda a visualização de notas como Nota por letra.","gpa_scale_scores_explainer":"As únicas pontuações permitidas são predefinidas no esquema de avaliação.","gpa_scale_title":"\\"O que é a Avaliação em Escala GPA?\\"","view_grading_scheme":"Ver esquema de avaliação"}}},"pt-BR":{"assignments":{"grading_type_selector":{"display_grade_as":"Exibir nota como","gpa_scale_explainer":"A atribuição de notas na escala GPA foi criada para as escolas que usam uma escala de 4,0 (ou 5,0/6,0) para todas as tarefas. Este sistema de notas é semelhante à exibição de Nota por conceito, mas apresenta algumas diferenças importantes:","gpa_scale_input_explainer":"As pontuações são inseridas na escala de 4,0. Por exemplo, se uma tarefa for de 100 pontos, inserir 4,0 resulta em 100%, 3,0 resulta em 87%, etc.","gpa_scale_letters_explainer":"As notas por conceito podem ser usadas com as notas em número.","gpa_scale_percentage_explainer":"Não é possível inserir pontos diretamente, mas você pode inserir percentagens. Por exemplo, se uma tarefa valer 50 pontos, inserir \\"40\\" não funciona, mas \\"80%\\" funciona.","gpa_scale_recommendation":"A menos que sua escola use uma escala de 4,0 (ou 5,0/6,0) para atribuição de notas, o Canvas recomenda a exibição das notas como Nota por conceito.","gpa_scale_scores_explainer":"As únicas pontuações permitidas são predefinidas no sistema de notas.","gpa_scale_title":"\\"O que é a atribuição de notas na escala GPA?\\"","view_grading_scheme":"Visualizar esquema de avaliação"}}},"ru":{"assignments":{"grading_type_selector":{"display_grade_as":"Отобразить оценку в виде","gpa_scale_explainer":"Система оценок GPA разработана для школ, которые используют для всех заданий 4.0-бальную (или 5.0/6.0) систему оценок. Данная схема оценки аналогична выставлению буквенных оценок, однако содержит некоторые важные отличия:","gpa_scale_input_explainer":"Оценки вводятся в 4,0-бальной системе оценки. Например, если задание набрало 100 баллов, ввод результата 4,0 соответствует 100%, результат 3,0 соответствует 87% и т. д.","gpa_scale_letters_explainer":"Буквенные оценки могут использоваться в качестве дополнения к цифровым оценкам.","gpa_scale_percentage_explainer":"Вы не можете вводить непосредственно оценки, однако можете вводить проценты. Например, если задание рассчитано на 50 баллов, поставить «40» не получится, однако можно ввести \\"80%\\".","gpa_scale_recommendation":"В случаях, когда ваша школа не использует 4.0-бальную (или 5.0/6.0) систему для выставления оценок, Canvas рекомендует вам выставлять оценки с помощью буквенной системы оценки.","gpa_scale_scores_explainer":"Допустимые оценки указаны в схеме оценки.","gpa_scale_title":"\\"Что такое система оценок GPA?\\"","view_grading_scheme":"Просмотр схемы оценок"}}},"sl":{"assignments":{"grading_type_selector":{"display_grade_as":"Prikaži oceno kot","gpa_scale_explainer":"Ocenjevalna lestvica GPA je zasnovana za šole, ki za vse naloge uporabljajo štiristopenjsko lestvico (ali pet-/šeststopenjsko). Ta ocenjevalna shema je podobna prikazu črkovnih ocen, z nekaj pomembnimi razlikami:","gpa_scale_input_explainer":"Rezultati so vneseni na štiristopenjsko lestvico. Če nalogo na primer sestavlja 100 točk, vnos četrte stopnje znaša 100 %, vnos tretje stopnje znaša 87 % itd.","gpa_scale_letters_explainer":"Poleg numeričnih je mogoče uporabiti črkovne ocene.","gpa_scale_percentage_explainer":"Točk ne morete vnašati neposredno, lahko pa vnašate odstotke. Če nalogo na primer sestavlja 50 točk, vnos »40« ne bo deloval, vnos »80 %« pa bo.","gpa_scale_recommendation":"V sistemu Canvas je za ocenjevanje priporočen prikaz ocen v črkovni obliki, razen če šola uporablja ocene v obliki štiristopenjske (ali pet-/šeststopenjske) lestvice.","gpa_scale_scores_explainer":"Edini dovoljeni rezultati so v ocenjevalni shemi vnaprej določeni.","gpa_scale_title":"»Kaj je ocenjevalna lestvica GPA«?","view_grading_scheme":"Ogled ocenjevalne sheme"}}},"sv":{"assignments":{"grading_type_selector":{"display_grade_as":"Visa omdöme som","gpa_scale_explainer":"Bedömning enligt genomsnittsbetyg har utformats för skolor som använder en 4,0-skala (eller 5,0/6,0) för alla uppgifter. Det här bedömningsschemat liknar bokstavsomdöme men har några viktiga skillnader:","gpa_scale_input_explainer":"Poäng skrivs in i 4,0-skalan. Till exempel, om en uppgift kan få totalt 100 poäng, är ett 4,0 resultat 100 %, 3,0 resultat 87 %, osv.","gpa_scale_letters_explainer":"Bokstavsomdöme kan användas utöver sifferbetyg.","gpa_scale_percentage_explainer":"Du kan inte skriva in poäng direkt, utan du kan skriva in procentandelar. Till exempel, om en uppgift får totalt 50 poäng fungerar det inte att skriva in ”40”, utan du skriver in 80 %.","gpa_scale_recommendation":"Om er skola inte använder en 4,0-skala (eller 5,0/6,0) för bedömning rekommenderar Canvas att omdömen visas som bokstavsomdöme.","gpa_scale_scores_explainer":"De enda tillåtna resultaten är förinställda i bedömningsschemat.","gpa_scale_title":"\\"Vad är bedömning enligt genomsnittsbetyg?\\"","view_grading_scheme":"Visa bedömningsschema"}}},"sv-x-k12":{"assignments":{"grading_type_selector":{"display_grade_as":"Visa omdöme som","gpa_scale_explainer":"Bedömning enligt genomsnittsbetyg har utformats för skolor som använder en 4,0-skala (eller 5,0/6,0) för alla uppgifter. Det här bedömningsschemat liknar bokstavsomdöme men har några viktiga skillnader:","gpa_scale_input_explainer":"Poäng skrivs in i 4,0-skalan. Till exempel, om en uppgift kan få totalt 100 poäng, är ett 4,0 resultat 100 %, 3,0 resultat 87 %, osv.","gpa_scale_letters_explainer":"Bokstavsomdöme kan användas utöver sifferbetyg.","gpa_scale_percentage_explainer":"Du kan inte skriva in poäng direkt, utan du kan skriva in procentandelar. Till exempel, om en uppgift får totalt 50 poäng fungerar det inte att skriva in ”40”, utan du skriver in 80 %.","gpa_scale_recommendation":"Om er skola inte använder en 4,0-skala (eller 5,0/6,0) för bedömning rekommenderar Canvas att omdömen visas som bokstavsomdöme.","gpa_scale_scores_explainer":"De enda tillåtna resultaten är förinställda i bedömningsschemat.","gpa_scale_title":"\\"Vad är bedömning enligt genomsnittsbetyg?\\"","view_grading_scheme":"Visa bedömningsschema"}}},"tr":{"assignments":{"grading_type_selector":{"display_grade_as":"Notu şu olarak Göster","gpa_scale_explainer":"GNO Notlandırma Ölçeği, tüm ödevler için  4.0 (veya 5.0/6.0) ölçeği kullanan okullar için tasarlanmıştır. Bu notlandırma şeması Harf Notu görünümüne benzemekle birlikte bazı farklılıkları barındırmaktadır:","gpa_scale_input_explainer":"Notlar 4.0 ölçeği üzerinden verilir. Örneğin, bir ödev 100 puan değerinde ise, 4.0 %100, 3.0 %87 vb. anlamına gelir.","gpa_scale_letters_explainer":"Rakam içeren notlandırmalara ek olarak harf notları kullanılabilir.","gpa_scale_percentage_explainer":"Yüzdeleri doğrudan girebilirken puanları doğrudan giremezsiniz. Örneğin, eğer bir ödev 50 puan ise \'\'40\'\' değerini girmek işe yaramayacaktır; \'\'%80\'\' girilmelidir.","gpa_scale_recommendation":"Okulunuz notlandırma için 4.0 (veya 5.0/6.0) ölçeği kullanmıyorsa Canvas notları Harf Notu olarak göstermenizi önerir.","gpa_scale_scores_explainer":"İzin verilen puanlar notlandırma şemasında önceden belirlenmiş olanlardır.","gpa_scale_title":"\'\'GNO Notlandırma Ölçeği Nedir?\'\'","view_grading_scheme":"Notlandırma Şemasını Göster"}}},"uk":{"assignments":{"grading_type_selector":{"display_grade_as":"Показати оцінку як","gpa_scale_explainer":"GPA Шкала оцінювання розроблена для шкіл, що використовують  шкалу 4.0 (або 5.0/6.0) для всіх завдань. Ця схема оцінювання схожа на оцінювання літерами, але має деякі важливі відмінності:","gpa_scale_input_explainer":"Результати вводяться за шкалою 4.0. Наприклад, якщо завдання максимально оцінюється у 100 баллів, вводиться результат 4.0 якщо результат 100%, 3.0 для результату у 87%, і т.д.","gpa_scale_letters_explainer":"Оцінювання літерами може бути використано на додаток до числових оцінок.","gpa_scale_percentage_explainer":"Ви не можете ввести бали безпосередньо, але можете ввести відсотки. Наприклад, якщо завдання складється з 50 балів, ввести \\"40\\" не вийде, але \\"80%\\" працюватиме.","gpa_scale_recommendation":"Якщо Ваша школа не використовує шкалу 4.0 (або 5.0/6.0) для оцінювання, Canvas рекомендує відображати оцінки у вигляді літер. ","gpa_scale_scores_explainer":"Лише дозволені оцінки визначені в шкалі оцінювання.","gpa_scale_title":"\\"Що таке GPA Шкала оцінювання?\\"","view_grading_scheme":"Переглянути схему оцінювання"}}},"zh-Hans":{"assignments":{"grading_type_selector":{"display_grade_as":"计分显示为","gpa_scale_explainer":"GPA 等级评分面向使用 4.0（或 5.0/6.0）等级评定所有作业的学校而设计。这一评分方案类似于字母评分显示，但存在一些重要的差别：","gpa_scale_input_explainer":"根据 4.0 等级来输入分数。例如，如果作业总共为 100 分，输入 4.0 则结果为 100%，输入 3.0 则结果为 87% 等等。","gpa_scale_letters_explainer":"除了数字评分以外，还可以使用字母评分。","gpa_scale_percentage_explainer":"您不能直接输入分数，但可以输入百分比。例如，如果作业总共为 50 分，输入“40”则无效，而输入“80%”则有效。","gpa_scale_recommendation":"除非您的学校使用 4.0（或 5.0/6.0）等级进行评分，否则 Canvas 建议以字母评分方式显示评分。","gpa_scale_scores_explainer":"只允许使用评分方案中预定义的分数。","gpa_scale_title":"“什么是 GPA 等级评分？”","view_grading_scheme":"查看评分方案"}}},"zh-Hant":{"assignments":{"grading_type_selector":{"display_grade_as":"將成績顯示為","gpa_scale_explainer":"GPA 量表評分系統專門針對使用 4.0（或 5.0/6.0）評分量表的學校設計。該評分方案類似於字母成績顯示的評分分案，但具有一些重要的差異：","gpa_scale_input_explainer":"得分在 4.0 量表系統的基礎上輸入。例如，如果一個作業滿分為 100 分，則以 100 分為 4.0 的評分，而 87 分則等於 3.0 的評分，以此類推。","gpa_scale_letters_explainer":"除了數字成績以外，還可以使用字母成績。","gpa_scale_percentage_explainer":"不能直接輸入分數，但是可以輸入百分比。例如，如果一個作業滿分 50 分，那麼，輸入『40』是行不通的，但是『80％』則可以。","gpa_scale_recommendation":"除非您的學校採用的是 4.0 （或 5.0/6.0）量表系統進行評分，否則 Canvas 建議將成績轉換為字母成績。","gpa_scale_scores_explainer":"允許的唯一分數需在評分方案中預定義。","gpa_scale_title":"『何為 GPA 量表評分？』","view_grading_scheme":"檢視評分方案"}}}}'))
